import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Home } from "./components/pages/Home";
import { About } from "./components/pages/About";
import { NavListItem, NavListLink, NavMenu } from "./components/NavMenu/NavMenu";
import { Projects } from "./components/pages/Projects";

function App() {
  return (
    <Router>
      <div>
        <NavMenu>
            <NavListItem>
              <NavListLink to="/">Home</NavListLink>
            </NavListItem>
            <NavListItem>
              <NavListLink to="/about">About</NavListLink>
            </NavListItem>
            <NavListItem>
              <NavListLink to="/projects">Projects</NavListLink>
            </NavListItem>
            <NavListItem>
              <NavListLink to="/contact">Contact</NavListLink>
            </NavListItem>
        </NavMenu>
        <Routes>
          <Route path="/" element={<Home />}/>
          <Route path="/about" element={<About />}/>
          <Route path="/projects" element={<Projects />}/>
          <Route path="/contact" element={<Contact />}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
